import { Injectable } from '@angular/core';
import { ComplicationAgAnemie } from '../models/ComplicationAgAnemie';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AgService {
  private apiUrl = 'https://localhost:7129/api/ComplicationAgAnemies';

  constructor(private http: HttpClient) { }
  addag(ComplicationAgAnemie: ComplicationAgAnemie): Observable<any> {
    console.log('Creating it with data:', ComplicationAgAnemie);

    return this.http.post(`${this.apiUrl}/addag`, ComplicationAgAnemie, { observe: 'response', responseType: 'text' });
  }
  getById(patientId: number): Observable<any> {
    return this.http.get<any>(`${this.apiUrl}/${patientId}`);
  }

update(PatientId: number, complication: ComplicationAgAnemie): Observable<any> {
  const url = `https://localhost:7129/api/ComplicationAgAnemies/update/${PatientId}`;
  return this.http.put(url, complication, {
    headers: new HttpHeaders({
      'Content-Type': 'application/json'
    })
  });}
}
